 duration,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.duedate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as max_duration,\n case when stg_workflow_instances.enddate is null then concat(dm_dim_alfresco.url,\'/alfresco/service/api/workflow-instances/\',stg_workflow_instances.id,\'/diagram\') else \'Unknown\' end as diagram_url,\n stg_workflow_instances.definitionurl as definition_url,\n \'UNKNOWN\' as initiator_unknown,\n \'Unknown\' as definition_url_unknown\nfrom\n stg_workflow_instances\n join dm_dim_alfresco on stg_workflow_instances.alfresco_id = dm_dim_alfresco.id\nwhere\n stg_workflow_instances.alfresco_id = ${alfresco_id}\n'),(13902,41,734,0,'limit',0,'0'),(13903,41,734,0,'lookup',0,NULL),(13904,41,734,0,'execute_each_row',0,'N'),(13905,41,734,0,'variables_active',0,'Y'),(13906,41,734,0,'lazy_conversion_active',0,'N'),(13907,41,734,0,'cluster_schema',0,NULL),(13908,41,734,0,'row_distribution_code',0,NULL),(13909,41,735,0,'PARTITIONING_SCHEMA',0,NULL),(13910,41,735,0,'PARTITIONING_METHOD',0,'none'),(13911,41,735,0,'id_connection',1,NULL),(13912,41,735,0,'sql',0,'select \n dm_dim_workflow_instances.alfresco_id as alfresco_id,\n dm_dim_workflow_instances.id as id\nfrom\n dm_dim_workflow_instances\nwhere\n dm_dim_workflow_instances.alfresco_id = ${alfresco_id}\n and dm_dim_workflow_instances.is_active = \'TRUE\'\n and dm_dim_workflow_instances.src_id not in (\n  select stg_workflow_instances.id\n  from stg_workflow_instances\n  where stg_workflow_instances.alfresco_id = ${alfresco_id}\n )'),(13913,41,735,0,'limit',0,'0'),(13914,41,735,0,'lookup',0,NULL),(13915,41,735,0,'execute_each_row',0,'N'),(13916,41,735,0,'variables_active',0,'Y'),(13917,41,735,0,'lazy_conversion_active',0,'N'),(13918,41,735,0,'cluster_schema',0,NULL),(13919,41,735,0,'row_distribution_code',0,NULL),(14424,22,776,0,'PARTITIONING_SCHEMA',0,NULL),(14425,22,776,0,'PARTITIONING_METHOD',0,'none'),(14426,22,776,0,'compatible',