document_id\";\n          }\n          else if (getField(\"cmis_basetypeid\").equals(\"cmis:folder\")) {\n            field[\"key\"] = \"folder_id\";\n          }\n          else {\n            throw new Exception(\"Field \'cmis_basetypeid\' with value \'\" + getField(\"cmis_basetypeid\") + \"\'.\");\n          }\n        }\n      }\n\n      if (valueMeta.getType() == valueMeta.TYPE_STRING && row[i] != null) {\n        field[\"value\"] = \"\'\" + row[i] + \"\'\";\n      }\n      else if (valueMeta.getType() == valueMeta.TYPE_DATE && row[i] != null) {\n        var dt = row[i];\n        var dtStr = \"\";\n        dtStr += dt.getDate() + \"-\" + (dt.getMonth()+1) + \"-\" + (1900+dt.getYear());\n        dtStr += \"_\";\n        dtStr += dt.getHours() + \":\" + dt.getMinutes() + \":\" + dt.getSeconds();\n        field[\"value\"] = \"STR_TO_DATE(\'\" + dtStr + \"\', \'%d-%m-%Y_%H:%i:%s\')\";\n      }\n\n      fields[fields.length] = field;\n    }\n  }\n\n  return fields;\n}\n\nfunction getField(fieldName) {\n\n  for (var i=0; i < getInputRowMeta().size(); ++i) {\n    var valueMeta = getInputRowMeta().getValueMeta(i);\n    if (valueMeta.getName().equals(fieldName)) {\n      return row[i];\n    }\n  }\n\n  throw new Exception(\"Field \'\" + fieldName + \"\' is mandatory for the transformation.\");\n}\n\nfunction createInsertQuery(fields) {\n\n  var query = \"\";\n\n  query += \"INSERT INTO \" + getVariable(\"target_table\",\"\") + \" (\";\n\n  for (var i=0; i < fields.length; ) {\n    query += fields[i][\"key\"];\n    if (++i < fields.length) {\n      query += \", \";\n    }\n  }\n\n  query += \") VALUES (\";\n\n  for (var i=0; i < fields.length; ) {\n    query += fields[i][\"value\"];\n    if (++i < fields.length) {\n      query += \", \";\n    }\n  }\n\n  query += \");\";\n\n  return query;\n}\n'),(14711,9,798,0,'jsScript_type',0,NULL),(14712,9,798,0,'field_name',0,'query'),(14713,9,798,0,'field_rename',0,'query'),(14714,9,798,0,'field_type',0,'String'),(14715,9,798,0,'fi